INSERT INTO `v1_c8873e8204afcac4faa13e468fcd8a3e43ccf6059f2ea8a5933478ee2733eb6e` VALUES (1.47, 1, 126401, "2023/09/22 14:59:59", "いらっしゃいませっ♪\nキャラバンコインを使って\n買い物ができますよっ！", 2, 2002, 0.0, -470.0, 1, 1, "クローチェ", 10001, "2023/06/30 12:00:00");
INSERT INTO `v1_c8873e8204afcac4faa13e468fcd8a3e43ccf6059f2ea8a5933478ee2733eb6e` VALUES (2.15, 1, 126401, "2023/09/22 14:59:59", "素敵な品が揃ってるので\nたーっくさん買っていって\nくださいねっ♪", 1, 2002, 0.0, -470.0, 2, 2, "クローチェ", 10002, "2023/06/30 12:00:00");
INSERT INTO `v1_c8873e8204afcac4faa13e468fcd8a3e43ccf6059f2ea8a5933478ee2733eb6e` VALUES (0.0, 1, 126501, "2023/09/22 14:59:59", "ショップへようこそ\nキャラバンコインはこちら\nで買い物に使えますよ", 2, 2002, 0.0, -470.0, 1, 2, "ライラエル", 10003, "2023/06/30 12:00:00");
INSERT INTO `v1_c8873e8204afcac4faa13e468fcd8a3e43ccf6059f2ea8a5933478ee2733eb6e` VALUES (0.0, 1, 126501, "2023/09/22 14:59:59", "こちらのショップで\n買い物をして、素敵な\n旅を楽しんでくださいね", 1, 2002, 0.0, -470.0, 2, 1, "ライラエル", 10004, "2023/06/30 12:00:00");
INSERT INTO `v1_c8873e8204afcac4faa13e468fcd8a3e43ccf6059f2ea8a5933478ee2733eb6e` VALUES (0.0, 2, 127702, "2023/12/22 14:59:59", "いらっしゃいませ\nキャラバンコインを使って\nお買い物ができますよ", 2, 2002, 0.0, -470.0, 1, 2, "リンド", 10005, "2023/09/15 15:00:00");
INSERT INTO `v1_c8873e8204afcac4faa13e468fcd8a3e43ccf6059f2ea8a5933478ee2733eb6e` VALUES (0.0, 2, 127702, "2023/12/22 14:59:59", "ショップの掃除は完璧です\n姫さま直営のお店として\n当然のことですから", 2, 2002, 0.0, -470.0, 2, 2, "リンド", 10006, "2023/09/15 15:00:00");
INSERT INTO `v1_c8873e8204afcac4faa13e468fcd8a3e43ccf6059f2ea8a5933478ee2733eb6e` VALUES (0.0, 2, 127802, "2023/12/22 14:59:59", "ショップへようこそ\nキャラバンコインと品物を\n交換できるんで、よければ", 1, 2002, 0.0, -470.0, 1, 1, "ヴルム", 10007, "2023/09/15 15:00:00");
INSERT INTO `v1_c8873e8204afcac4faa13e468fcd8a3e43ccf6059f2ea8a5933478ee2733eb6e` VALUES (6.5, 2, 127802, "2023/12/22 14:59:59", "なんで店番なんか…\nま、やりますけど\n好きな品物をどうぞ", 1, 2002, 0.0, -470.0, 2, 2, "ヴルム", 10008, "2023/09/15 15:00:00");
INSERT INTO `v1_c8873e8204afcac4faa13e468fcd8a3e43ccf6059f2ea8a5933478ee2733eb6e` VALUES (0.0, 3, 129602, "2024/03/22 14:59:59", "──いらっしゃいませ\n買い物しても、いいですよ\nキャラバンコインがあれば", 1, 2002, 0.0, -470.0, 1, 2, "アネモネ", 10009, "2023/12/15 15:00:00");
INSERT INTO `v1_c8873e8204afcac4faa13e468fcd8a3e43ccf6059f2ea8a5933478ee2733eb6e` VALUES (0.0, 3, 129602, "2024/03/22 14:59:59", "──もっと笑顔がほしい？\nいくらコインを積まれても\n売れない物はありますから", 1, 2002, 0.0, -470.0, 2, 2, "アネモネ", 10010, "2023/12/15 15:00:00");
INSERT INTO `v1_c8873e8204afcac4faa13e468fcd8a3e43ccf6059f2ea8a5933478ee2733eb6e` VALUES (0.0, 3, 129701, "2024/03/22 14:59:59", "ようこそおいでなんし\nキャラバンコインをこちら\nで交換して進ぜんしょう", 1, 2002, 0.0, -470.0, 1, 1, "ネフィ=ネラ", 10011, "2023/12/15 15:00:00");
INSERT INTO `v1_c8873e8204afcac4faa13e468fcd8a3e43ccf6059f2ea8a5933478ee2733eb6e` VALUES (6.2, 3, 129701, "2024/03/22 14:59:59", "ところで、お前さまは\nいくらで贖えるのか喃？\n──フフ、冗談でありんす", 1, 2002, 0.0, -470.0, 2, 2, "ネフィ=ネラ", 10012, "2023/12/15 15:00:00");
INSERT INTO `v1_c8873e8204afcac4faa13e468fcd8a3e43ccf6059f2ea8a5933478ee2733eb6e` VALUES (3.1, 4, 130301, "2024/06/22 14:59:59", "い、いらっしゃいませっ！\n…くっ…このあたくし様が\n店番なんて…屈辱ですわっ", 5, 2002, 0.0, -470.0, 1, 3, "カノン", 10013, "2024/03/15 15:00:00");
INSERT INTO `v1_c8873e8204afcac4faa13e468fcd8a3e43ccf6059f2ea8a5933478ee2733eb6e` VALUES (6.15, 4, 130301, "2024/06/22 14:59:59", "あら、あたくしをご所望？\nお生憎様、そんな小銭では\n…買えちゃうんですの！？", 2, 2002, 0.0, -470.0, 2, 3, "カノン", 10014, "2024/03/15 15:00:00");
INSERT INTO `v1_c8873e8204afcac4faa13e468fcd8a3e43ccf6059f2ea8a5933478ee2733eb6e` VALUES (0.0, 4, 130401, "2024/06/22 14:59:59", "いらっしゃいませ～♪\nきゃらばんこいん？を\n交換できるんだってー", 2, 2002, 0.0, -470.0, 1, 2, "ナーナ", 10015, "2024/03/15 15:00:00");
INSERT INTO `v1_c8873e8204afcac4faa13e468fcd8a3e43ccf6059f2ea8a5933478ee2733eb6e` VALUES (3.35, 4, 130401, "2024/06/22 14:59:59", "甘いのくれたら、\nお礼にナーナの拾った\n松ぼっくりあげちゃうよ！", 1, 2002, 0.0, -470.0, 2, 2, "ナーナ", 10016, "2024/03/15 15:00:00");
INSERT INTO `v1_c8873e8204afcac4faa13e468fcd8a3e43ccf6059f2ea8a5933478ee2733eb6e` VALUES (0.0, 5, 130502, "2024/09/22 14:59:59", "ショップへようこそ\nこの鳳凰が、皆さんに\n祝福を差し上げましょう", 1, 2002, 0.0, -470.0, 1, 1, "ホウオウ", 10017, "2024/06/15 15:00:00");
INSERT INTO `v1_c8873e8204afcac4faa13e468fcd8a3e43ccf6059f2ea8a5933478ee2733eb6e` VALUES (3.18, 5, 130502, "2024/09/22 14:59:59", "ほーちゃんと呼ぶ権利は\n売っていませんよ？\n騎士さんへの、特別です！", 1, 2002, 0.0, -470.0, 2, 2, "ホウオウ", 10018, "2024/06/15 15:00:00");
INSERT INTO `v1_c8873e8204afcac4faa13e468fcd8a3e43ccf6059f2ea8a5933478ee2733eb6e` VALUES (0.0, 5, 130503, "2024/09/22 14:59:59", "うﾞぇぇえんっ！まﾞだごの\n格好になっぢゃいまじだ！\n寄付をお願いじまず～っ！", 4, 2002, 0.0, -470.0, 3, 4, "ホウオウ", 10019, "2024/06/15 15:00:00");
INSERT INTO `v1_c8873e8204afcac4faa13e468fcd8a3e43ccf6059f2ea8a5933478ee2733eb6e` VALUES (4.9, 5, 123301, "2024/09/22 14:59:59", "おっすー♪\nなんでも交換してけー\nカリザきゅん以外で", 2, 2002, 0.0, -470.0, 1, 1, "ネア", 10020, "2024/06/15 15:00:00");
INSERT INTO `v1_c8873e8204afcac4faa13e468fcd8a3e43ccf6059f2ea8a5933478ee2733eb6e` VALUES (4.8, 5, 123301, "2024/09/22 14:59:59", "ところで、騎士きゅんは\nおいくら万ルピ？\nジョーダンぬ・き・で♡", 2, 2002, 0.0, -470.0, 2, 1, "ネア", 10021, "2024/06/15 15:00:00");
INSERT INTO `v1_c8873e8204afcac4faa13e468fcd8a3e43ccf6059f2ea8a5933478ee2733eb6e` VALUES (4.922, 6, 133301, "2024/12/22 14:59:59", "ケッ、なんでオレ様が店番\nなんざ…って来んなキイロ\nオレは売りモンじゃねー！", 1, 2002, 0.0, -470.0, 1, 3, "カリザ", 10022, "2024/09/15 15:00:00");
INSERT INTO `v1_c8873e8204afcac4faa13e468fcd8a3e43ccf6059f2ea8a5933478ee2733eb6e` VALUES (9.638, 6, 133301, "2024/12/22 14:59:59", "い、言わなきゃダメか？\n「…いらっしゃいませ…」\nクソッ、笑うんじゃねー！", 5, 2002, 0.0, -470.0, 2, 3, "カリザ", 10023, "2024/09/15 15:00:00");
INSERT INTO `v1_c8873e8204afcac4faa13e468fcd8a3e43ccf6059f2ea8a5933478ee2733eb6e` VALUES (2.88, 6, 133401, "2024/12/22 14:59:59", "ショップへようこそ～\nネラさまの腹心…的な私が\n店番させていただきま～す", 2, 2002, 0.0, -470.0, 1, 1, "ミーア", 10024, "2024/09/15 15:00:00");
INSERT INTO `v1_c8873e8204afcac4faa13e468fcd8a3e43ccf6059f2ea8a5933478ee2733eb6e` VALUES (4.818, 6, 133401, "2024/12/22 14:59:59", "私の抜け殻とか、\n需要ありますかね～…\nって冗談ですよ、冗談！", 1, 2002, 0.0, -470.0, 2, 5, "ミーア", 10025, "2024/09/15 15:00:00");
INSERT INTO `v1_c8873e8204afcac4faa13e468fcd8a3e43ccf6059f2ea8a5933478ee2733eb6e` VALUES (1.78, 7, 133002, "2025/03/22 14:59:59", "へい、らっしゃい\nさ、騎士氏。冥土の土産は\nなにがいいですか？", 1, 2002, 0.0, -470.0, 1, 2, "グレイス", 10026, "2024/12/15 15:00:00");
INSERT INTO `v1_c8873e8204afcac4faa13e468fcd8a3e43ccf6059f2ea8a5933478ee2733eb6e` VALUES (6.15, 7, 133002, "2025/03/22 14:59:59", "商品をお買い上げ毎に\nグレイスちゃんポイントを\n差し上げます。嘘ですが", 7, 2002, 0.0, -470.0, 2, 1, "グレイス", 10027, "2024/12/15 15:00:00");
INSERT INTO `v1_c8873e8204afcac4faa13e468fcd8a3e43ccf6059f2ea8a5933478ee2733eb6e` VALUES (4.28, 7, 133102, "2025/03/22 14:59:59", "ようこそいらっしゃいませ\n…接客とは、このような\n振舞で宜しいでしょうか？", 2, 2002, 0.0, -470.0, 1, 6, "ヴァイオレット", 10028, "2024/12/15 15:00:00");
INSERT INTO `v1_c8873e8204afcac4faa13e468fcd8a3e43ccf6059f2ea8a5933478ee2733eb6e` VALUES (0.0, 7, 133102, "2025/03/22 14:59:59", "じめじめした商品は\nございませんので\n安心してお買い求め下さい", 1, 2002, 0.0, -470.0, 2, 1, "ヴァイオレット", 10029, "2024/12/15 15:00:00");
INSERT INTO `v1_c8873e8204afcac4faa13e468fcd8a3e43ccf6059f2ea8a5933478ee2733eb6e` VALUES (5.53, 8, 136902, "2025/06/23 14:59:59", "いらっしゃいましぇでしゅ\n何をお求めでしゅか？\nたこ焼きもありましゅよ！", 1, 2002, 0.0, -470.0, 1, 2, "ルルィ", 10030, "2025/03/15 15:00:00");
INSERT INTO `v1_c8873e8204afcac4faa13e468fcd8a3e43ccf6059f2ea8a5933478ee2733eb6e` VALUES (6.05, 8, 136902, "2025/06/23 14:59:59", "そのコイン…ピカピカで、\n集めたくなっちゃいましゅ\nタコ釣られされちゃう～…", 7, 2002, 0.0, -470.0, 2, 9, "ルルィ", 10031, "2025/03/15 15:00:00");
INSERT INTO `v1_c8873e8204afcac4faa13e468fcd8a3e43ccf6059f2ea8a5933478ee2733eb6e` VALUES (0.0, 8, 137001, "2025/06/23 14:59:59", "姫のご友人ならば\n礼儀を尽くすのが爺の務め\nさ、望みの物を言いたまえ", 1, 2002, 0.0, -470.0, 1, 2, "デュラン", 10032, "2025/03/15 15:00:00");
INSERT INTO `v1_c8873e8204afcac4faa13e468fcd8a3e43ccf6059f2ea8a5933478ee2733eb6e` VALUES (0.0, 8, 137001, "2025/06/23 14:59:59", "キャラバンコインではなく\n首で支払って貰えんかのぅ\n…冗談であるぞ？", 1, 2002, 0.0, -470.0, 2, 2, "デュラン", 10033, "2025/03/15 15:00:00");
